import React from 'react';
import SchemeCard from './SchemeCard';
import './SchemeList.css';

// --- UPDATED: Pass down new props ---
const SchemeList = ({ schemes, onRemove }) => {
  if (schemes.length === 0) {
    return <p>No schemes found.</p>;
  }

  return (
    <div className="schemes-list">
      {schemes.map((schemeData) => {
        // Handle both raw scheme objects and SavedScheme objects
        const scheme = schemeData.scheme ? schemeData.scheme : schemeData;
        const savedSchemeId = schemeData.scheme ? schemeData._id : null;
        
        return (
          <SchemeCard 
            key={scheme._id} 
            scheme={scheme}
            savedSchemeId={savedSchemeId}
            onRemove={onRemove}
          />
        );
      })}
    </div>
  );
};

export default SchemeList;
